import React from 'react'

export class ShowInfo extends Component {  
  render() {
  return (
    <header>
        <div>
            <span className='logo'>House staff</span>
            <ul className='nav'>
                <li onClick={() => this.props.onShowInfo()}>Про нас</li>
                <li>Контакты</li>
            </ul>
          </div>
        <div className='presentation'> </div>
      </header>
    )
  }
}
